def h_fork(player, opp):#, move=0):
	#evaluates board using weighted heuristics
	# heuristics = [h_symmetricmoves, h_stable, h_c, h_x, h_corners]
	# #heuristics = [h_stable, h_c, h_x, h_corners]
	# weights = [40, 90, 60, 40, 1111]
	# #weights = [90, 60, 40, 1111]
	if bin(player).count('1') == 0:
		return -999999
	node = hex(player<<64|opp)
	if node in heuristic_cache:
		return heuristic_cache[node]
	heuristics = [h_frontiers, h_stable, h_x, h_c, h_corners]
	weights = [55, 140, 80, 110, 1679]
	#weights = [40, 140, 225, 175, 1300]
	# if move:
	# 	player, opp = make_move(player, opp, move)
	count = 0
	for w, f in zip(weights, heuristics):
		count += w * f(player, opp)
	heuristic_cache[node] = count
	return count

def h_corners(player, opp):
	# returns player's corners - opp's corners
	return bin(player&0x8100000000000081).count('1')-bin(opp&0x8100000000000081).count('1') 

def h_edges(player, opp):
	#player edges - opp edges
	return bin(player&0xFF818181818181FF).count('1') - bin(opp&0xFF818181818181FF).count('1')

def h_stable(player, opp):
	#returns player stable pieces - opp stable pieces
	return 1.4*bin(stable_pieces(player)).count('1') - bin(stable_pieces(opp)).count('1') 

def h_x(player, opp):
	#returns opp unsafe x - player unsafe x
	return unsafe_x(opp)-unsafe_x(player)

def h_c(player, opp):
	return unsafe_c(opp)-unsafe_c(player)

def h_tokens(player, opp):

	return bin(player).count('1')-bin(opp).count('1')

def h_standard(player, opp):

	return bin(player).count('1')

def h_symmetricmoves(player, opp):

	return 1.4*bin(possible_moves(player, opp)).count('1')-bin(possible_moves(opp, player)).count('1') #returns player moves - opp moves

def h_playermoves(player, opp):

	return bin(possible_moves(player, opp)).count('1')

def h_opponentmoves(player, opp):

	return bin(possible_moves(opp, player)).count('1')

def h_frontiers(player, opp):
	board = player | opp
	notboard = ~ board
	shift = board & (notboard >> 8|notboard << 8|(notboard & ~left) << 1|(notboard & ~right) >> 1|(notboard & ~botr) >> 9|(notboard & ~botl) >> 7|(notboard & ~topl) << 9|(notboard & ~topr) << 7)
	return bin(shift&opp).count('1') - bin(shift&player).count('1')

def stable_pieces(board):#****************************************
	stable = 0
	while True:
		table = board & ((stable >> 8 | top) | (bottom << 8 | bottom)) & ((stable >> 1 | left) | (right << 1 | right)) & ((stable >> 7 | topr) | (botl << 7 | botl)) & ((stable >> 9 | topl) | (botr << 9 | botr))
		print(table)
		if not (table ^ stable): break
		stable |= table
	return stable 

def unsafe_x(player):
	#returns number of unsafe x pieces
	count = 0
	if (1 << 9) & player and not (1 << 0) & player: count += 1
	if (1 << 14) & player and not (1 << 7) & player: count += 1
	if (1 << 49) & player and not (1 << 56) & player: count += 1
	if (1 << 54) & player and not (1 << 63) & player: count += 1
	return count 

def unsafe_c(player):
	#returns number of unsafe c pieces
	count = 0
	if (1 << 1) & player and not (1 << 0) & player: count += 1
	if (1 << 8) & player and not (1 << 0) & player: count += 1
	if (1 << 6) & player and not (1 << 7) & player: count += 1
	if (1 << 15) & player and not (1 << 7) & player: count += 1
	if (1 << 48) & player and not (1 << 56) & player: count += 1
	if (1 << 57) & player and not (1 << 56) & player: count += 1
	if (1 << 55) & player and not (1 << 63) & player: count += 1
	if (1 << 62) & player and not (1 << 63) & player: count += 1
	return count 

def local_moves (player, opp_e, shift):#****************************************
	level = (player << shift) | (player >> shift) & opp_e
	for i in range(5):
		level |= (level << shift) | (level >> shift) & opp_e
	return (level << shift) | (level >> shift) #across 4 axis--->SHIFTTT

def possible_moves(player, opp):#****************************************
	node = hex(int(str(player) + str(opp)))
	if node in move_cache:
		return move_cache[node]
	mask = 0x7E7E7E7E7E7E7E7E
	opp_e = opp & mask
	full = 0xFFFFFFFFFFFFFFFF
	moves = local_moves(player, opp_e, 1) | local_moves(player, opp, 8) | local_moves(player, opp_e, 7) | local_moves(player, opp_e, 9)
	p = moves & (full ^ (player|opp))
	move_cache[node] = p
	return p

def make_move(player, opp, move):#**************************************** 
	mask = 0x7E7E7E7E7E7E7E7E
	opp_e = opp & mask
	full = 0xFFFFFFFFFFFFFFFF
	moves = some_flips(player, opp_e, 1, move) | some_flips(player, opp, 8, move) | some_flips(player, opp_e, 7, move) | some_flips(player, opp_e, 9, move)
	#returns flip int for all 4 axes
	return player|moves|move, opp^moves 

def some_flips(player, opp_e, shift, move):#****************************************
	#flips across a single axis
	level_c = ((player << shift) | (player >> shift)) & opp_e
	level_m = ((move << shift) | (move >> shift)) & opp_e
	for i in range(5):
		level_c |= ((level_c << shift) | (level_c >> shift)) & opp_e
		level_m |= ((level_m << shift) | (level_m >> shift)) & opp_e
	return level_c & level_m

def all_flips(player, opp, move):##USELESS
	mask = 0x7E7E7E7E7E7E7E7E
	opp_e = opp & mask
	full = 0xFFFFFFFFFFFFFFFF
	moves = some_flips(player, opp_e, 1, move) | some_flips(player, opp, 8, move) | some_flips(player, opp_e, 7, move) | some_flips(player, opp_e, 9, move)
	return moves #returns flip int for all 4 axes

def negamax(player, opp, levels, function):
	if not levels or possible_moves(player, opp) + possible_moves(opp, player) == 0:
		return [function(player, opp)]
	lm = possible_moves(player, opp)
	if not lm:
		nm = negamax(opp, player, levels - 1, function) + [-1]
		return [-nm[0]] + nm[1:]
	nmList = sorted([negamax(make_move(player, opp, mv)[1], make_move(player, opp, mv)[0], levels - 1, function) + [mv] for mv in deconstruct(lm)])
	best = nmList[0]
	#print(best)
	return [-best[0]] + best[1:]

